import React from 'react';

const Register = () => {
  return (
    <div className="register-container">
      <h2>Register for MeetYourNeed</h2>
      <p>Choose your role to get started: Client or Vendor</p>
      <button>Register as Client</button>
      <button>Register as Vendor</button>
    </div>
  );
};

export default Register;
